// still-working.js
import React from 'react';
import './stillworking.css'; 
import useTypewriter from './UseTypeWriter';



const StillWorking = ({ selectedLanguage }) => {
  const textTranslations = {
    intro: {
      English: "  I'm still working on the page, please check back later!",
      中文: "  這篇我還正在做，過一陣子再回來吧！"
    }
  };

  const text = useTypewriter(textTranslations.intro[selectedLanguage], 20, selectedLanguage);

  return (
    <div>
      <div className="still-working-container">
          <img className="still-working-img" src="../images/still-working.png" alt="Izzy Logo" loading="lazy"/>
        <div className="still-working-header-text">
          <h1>{text}</h1>
        </div>
      </div>
    </div>
  );
};

export default StillWorking;
